import React from 'react';
import './Money.css';
import Bill from './Bill';
import { FaMoneyBill } from 'react-icons/fa';

const bank_type = [

    {
            type : 20,
            amount: 100,
            color: 'green'
        },
    {
            type : 50,
            amount: 50,
            color: 'blue'
        },
        {
            type : 100,
            amount: 50,
            color: 'red'
        },
        {
            type : 500,
            amount: 20,
            color: 'purple'
        },
        {
            type : 1000,
            amount: 20,
            color: 'brown'
        }


];

const coin_type = [

    {
            type : 1,
            amount: 100,
            color: 'grey'
        },
    {
            type : 2,
            amount: 50,
            color: 'gold'
        },
        {
            type : 5,
            amount: 50,
            color: 'grey'
        },
        {
            type : 10,
            amount: 20,
            color: 'grey'
        },



];

function Money() {
    const showBill = bank_type.map((bill)=> <Bill id={bill.type} type={bill.type} amount={bill.amount}/>)
    return (
        <div className="Money">
            <table >
            <tr>
            <td>
                <p><FaMoneyBill/></p>
                <p>Amount</p>
            </td>
            {showBill}
            </tr>

            </table>


        </div>
    );
}

export default Money;
